const Discord = require('discord.js');
const client = new Discord.Client();

const prefix = '!'; // بادئة الأمر الخاصة بالروبوت

const countries = [
  { name: 'مصر', flag: ':eg:', capital: 'القاهرة' },
  { name: 'السعودية', flag: ':saudi_arabia:', capital: 'الرياض' },
  { name: 'الإمارات العربية المتحدة', flag: ':flag_ae:', capital: 'أبوظبي' },
  // ... إضافة المزيد من الدول هنا
];

let currentCountry;
let gameActive = false;

client.on('ready', () => {
  console.log('Bot is ready!');
});

client.on('message', (message) => {
  if (!message.content.startsWith(prefix) || message.author.bot) return;

  const args = message.content.slice(prefix.length).trim().split(' ');
  const command = args.shift().toLowerCase();

  if (command === 'flaggame' && args[0] === 'start') {
    if (gameActive) {
      return message.channel.send('There is already an active game. Finish it before starting a new one.');
    }

    currentCountry = getRandomCountry();
    gameActive = true;

    message.channel.send(`Guess the country by its flag! Here is your first flag: ${currentCountry.flag}`);
  } else if (command === 'flaggame' && args[0] === 'stop') {
    if (!gameActive) {
      return message.channel.send('There is no active game. Start a new game using !flaggame start.');
    }

    gameActive = false;
    message.channel.send(`The game has been stopped. The correct answer was ${currentCountry.name}.`);
  } else if (command === 'flaggame' && args[0]) {
    if (!gameActive) {
      return message.channel.send('There is no active game. Start a new game using !flaggame start.');
    }

    const guessedCountry = args.join(' ').toLowerCase();

    if (guessedCountry === currentCountry.name.toLowerCase()) {
      gameActive = false;
      message.channel.send(`Congratulations! You guessed it right. The country was ${currentCountry.name}.`);
    } else {
      message.channel.send('Oops! That\'s not the correct answer. Try again!');
    }
  }
});

function getRandomCountry() {
  return countries[Math.floor(Math.random() * countries.length)];
}

client.login('YOUR_BOT_TOKEN');